import { NavLink } from "react-router-dom";
import css from "./Messages.module.css"

const DialogItem = (props) => {
  return <div className={css.DialogItems}>
    <NavLink to={"/messages/" + props.id}> {props.name} </NavLink>
  </div>
}
const MessageText = (props) => {
  return <div className={css.MessageText}>
    {props.text}
  </div>
}


const Messages = () => {
  return (
    <div className={css.messages}>

      <div className={css.leftbar}>

        <DialogItem name="user1" id="1" />
        <DialogItem name="user2" id="2" />
        <DialogItem name="user3" id="3" />
        <DialogItem name="user4" id="4" />

      </div>

      <div className={css.rightBar}>
        <MessageText text="popa"/>
        <MessageText text="popaaaa"/>
        <MessageText text="popaaaaaaaa"/>
        <MessageText text="jopa"/>
      </div>

    </div>
  );
}

export default Messages;
